Table.Command:
DECLARE @DocKey INTEGER SET @DocKey = {?ServiceContractSubDocKey@}
DECLARE @ContractType NVARCHAR(1) SET @ContractType = 'S' DECLARE @CustomerCode NVARCHAR(15) SET @CustomerCode = (SELECT customer FROM OINS WHERE insID = @DocKey) DECLARE @ItemCode NVARCHAR(20) SET @ItemCode = (SELECT itemCode FROM OINS WHERE insID = @DocKey) DECLARE @SerialNumber NVARCHAR(32) SET @SerialNumber = (SELECT internalSN FROM OINS WHERE insID = @DocKey) DECLARE @Today DATETIME; SET @Today = CONVERT(NVARCHAR(8), GetDate(), 112);
SELECT T0.ContractID, T1.StartDate, T1.EndDate, T0.SrvcType FROM OCTR T0 INNER JOIN CTR1 T1 ON T1.ContractID = T0.ContractID WHERE T0.CntrcType = @ContractType AND T0.CstmrCode = @CustomerCode AND ((T1.StartDate <= @Today AND T1.EndDate >= @Today AND (T1.TermDate >= @Today OR T1.TermDate IS NULL)) OR T1.StartDate > @Today OR (T1.EndDate < @Today OR (T1.TermDate < @Today AND T1.TermDate IS NOT NULL))) AND T1.ItemCode = @ItemCode AND T1.InternalSN = @SerialNumber
